import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    <div className="navbar">
        <Link to="/">
            <img className="logo" src="webshio.png" alt=""/>
        </Link>
        <div className="navbar-btns">
                <Link to="add-item">
                    <button className="btn">Lisa uus ese</button>
                </Link>
                <Link to="/">
                    <button className="btn">Button1</button>
                </Link>
                <Link to="/">
                    <button className="btn">Button2</button>
                </Link>
        </div>


        <Link to="cart">
            <img className="cart" src="cart.svg" alt=""/>
        </Link>
    </div>

  );
}

// alumine tehke ise

export default Navbar;
